var TXMoudle = angular.module('tx', []),
    extend = angular.extend,
    jqLite = angular.element,


    forEach = angular.forEach,
    isDefined = angular.isDefined,
    isNumber = angular.isNumber,
    isString = angular.isString,
    noop = angular.noop;

TXMoudle
/**
 * input输入框表单
 * @ngdoc directive
 * @name txInputLists
 * @children txInputWrapper,txInputLabel,txInputLabel,txInput
 * @module tx
 * @restrict E *
 * @usage
 *
 *  <tx-input-lists>
 *      <tx-input-wrapper>
 *          <tx-input-label>学校名称</tx-input-label>
 *          <tx-input name="schoolName">
 *               <input class="text-input" type="text" ng-focus="focus()" ng-blur="blur()" ng-change="change()" ng-model="schoolName"/>
 *          </tx-input>
 *          </tx-input-wrapper>
 *      <tx-input-wrapper>
 *          <tx-input-label>班级名称</tx-input-label>
 *          <tx-input name="className">
 *              < input class="text-input" type="text" ng-focus="focus()" ng-blur="blur()" ng-change="change()" ng-model="className"/>
 *          </tx-input>
 *      </tx-input-wrapper>
 *  </tx-input-lists>
 */
    .directive('txInputLists', [function () {
        return {
            restrict: 'E',
            transclude: true,
            template: '<div ng-transclude></div>',
            compile: function (element, attr) {
                element.addClass('tx-input-lists')
            },
        }
    }])
    .directive('txInputWrapper', [function () {
        return {
            restrict: 'E',
            transclude: true,
            template: '<div class="inner-wrapper" ng-transclude></div>',
            compile: function (element, attr) {
                element.addClass('tx-input-wrapper')
            },
            controller: ['$scope', '$element', function ($scope, $element) {
                this.focus = function () {
                    console.log($scope)
                    jqLite($element).addClass('tx-input-focus')
                }
                this.blur = function (input, name) {
                    $scope.$parent[name] = input
                    if (input) return;
                    jqLite($element).removeClass('tx-input-focus')
                }
                this.change = function (input, name) {
                    $scope.$parent[name] = input
                }
            }]
        }
    }])
    .directive('txInputLabel', [function () {
        return {
            restrict: 'E',
            compile: function (element, attr) {
                element.addClass('tx-input-label')
            },
            controller: ['$scope', function ($scope) {
            }]
        }
    }])
    .directive('txInput', [function () {
        return {
            restrict: 'E',
            transclude: true,
            require: '?^txInputWrapper',
            template: '<div class="input-box" ng-transclude></div>',
            link: function (scope, element, attr, txInputWrapperCtrl) {
                jqLite(element).addClass('tx-input');
                scope.focus = function () {
                    txInputWrapperCtrl.focus();
                }
                scope.blur = function () {
                    txInputWrapperCtrl.blur(scope.$$childHead[attr.name], attr.name)
                }
                scope.change = function () {
                    console.log('change')
                    txInputWrapperCtrl.change(scope.$$childHead[attr.name], attr.name)
                }
            }
        }
    }])

    .factory('$txToast', [
        '$q',
        '$timeout',
        '$rootScope',
        '$compile',
        '$txBody',
        function ($q, $timeout, $rootScope, $compile, $txBody) {
            var $txToast = {
                success: showPopup,
                _createPopup: createPopup,
            };
            return $txToast;
            function createPopup(options) {
                options = extend({
                    scope: null,
                    text: '成功',
                    delay: 3000,
                    callback: function () {
                    }
                }, options || {});

                var self = {};
                self.scope = (options.scope || $rootScope).$new();
                self.element = jqLite(TOAST_TPL);
                self.responseDeferred = $q.defer();
                $txBody.append(self.element);
                $compile(self.element)(self.scope);
                extend(self.scope, {
                    text: options.text
                });
                self.show = function () {
                    self.element.removeClass('toast-hidden');
                    self.element.addClass('toast-show');
                    self.hide()
                };

                self.hide = function () {
                    $timeout(function () {
                        self.element.removeClass('toast-show');
                        self.element.addClass('toast-hidden');
                        self.remove()
                        if (options.callback) {
                            options.callback()
                        }
                    }, options.delay);
                };

                self.remove = function () {
                    self.element.remove();
                    self.scope.$destroy();
                };

                return self;
            }

            function showPopup(options) {
                if (!isNumber(options.delay)) {
                    options.delay = 3000
                }
                var toast = $txToast._createPopup(options);
                doShow();
                function doShow() {
                    toast.show()
                }

            }
        }
    ])
    .factory('$txToptip', [
        '$q',
        '$timeout',
        '$rootScope',
        '$compile',
        '$txBody',
        function ($q, $timeout, $rootScope, $compile, $txBody) {
            var $txToast = {
                success: showSuccessPopup,
                error: showErrorPopup,
                _createPopup: createPopup,
            };
            return $txToast;
            function createPopup(options, state) {
                options = extend({
                    scope: null,
                    text: '成功',
                    delay: 3000,
                    callback: function () {
                    }
                }, options || {});

                var self = {};
                self.scope = (options.scope || $rootScope).$new();
                self.element = jqLite(TOPTIP_TPL);
                self.responseDeferred = $q.defer();
                $txBody.append(self.element);
                $compile(self.element)(self.scope);
                extend(self.scope, {
                    text: options.text,
                    state: state
                });
                self.show = function () {
                    self.element.removeClass('toptip-hidden');
                    self.element.addClass('toptip-show');
                    self.element.children('.toptip-container').addClass(state);
                    self.hide()
                };
                self.hide = function () {
                    $timeout(function () {
                        self.element.removeClass('toptip-show');
                        self.element.addClass('toptip-hidden');
                        $timeout(function () {
                            self.remove();
                            if (options.callback) {
                                options.callback()
                            }
                        }, 500)
                    }, options.delay);
                };

                self.remove = function () {
                    self.element.remove();
                    self.scope.$destroy();
                };

                return self;
            }

            function showSuccessPopup(options) {
                if (!isNumber(options.delay)) {
                    options.delay = 3000
                }
                var toptip = $txToast._createPopup(options, 'success');
                $timeout(function () {
                    doShow();
                }, 50)
                function doShow() {
                    toptip.show()
                }

            }

            function showErrorPopup(options) {
                if (!isNumber(options.delay)) {
                    options.delay = 3000
                }
                var toptip = $txToast._createPopup(options, 'error');
                $timeout(function () {
                    doShow();
                }, 50)
                function doShow() {
                    toptip.show()
                }

            }
        }
    ])
    .factory('$txConfirm', [
        '$q',
        '$timeout',
        '$rootScope',
        '$compile',
        '$txBody',
        function ($q, $timeout, $rootScope, $compile, $txBody) {
            var $txToast = {
                success: showConfirm,
                _createPopup: createConfirm,
            };
            return $txToast;
            function createConfirm(options) {
                var self = {};
                self.show = function () {
                    self.element.removeClass('confirm-hidden');
                    self.element.addClass('confirm-show');
                };
                self.hide = function () {
                    $timeout(function () {
                        self.element.removeClass('confirm-show');
                        self.element.addClass('confirm-hidden');
                        $timeout(function () {
                            self.remove();
                            if (options.callback) {
                                options.callback()
                            }
                        }, 500)
                    }, options.delay);
                };

                self.remove = function () {
                    self.element.remove();
                    self.scope.$destroy();
                };
                options = extend({
                    scope: null,
                    title: '系统消息',
                    content: '内容',
                    cancelText: '取消',
                    confirmText: '确定',
                    cancelBtn: function () {
                        self.hide()
                    },
                    confirmBtn: function () {
                        self.hide()
                    }
                }, options || {});
                self.scope = (options.scope || $rootScope).$new();
                self.element = jqLite(CONFIRM_TPL);
                self.responseDeferred = $q.defer();
                $txBody.append(self.element);
                $compile(self.element)(self.scope);
                extend(self.scope, {
                    title: options.title,
                    content: options.content,
                    cancelText: options.cancelText,
                    confirmText: options.confirmText,
                    cancelBtn: function () {
                        self.hide();
                        options.cancelBtn()
                    },
                    confirmBtn: function () {
                        self.hide();
                        options.confirmBtn()
                    }
                });
                return self;
            }

            function showConfirm(options) {
                var confirm = $txToast._createPopup(options);
                $timeout(function () {
                    doShow();
                }, 50)
                function doShow() {
                    confirm.show()
                }

            }
        }
    ])
    .factory('$txBody', ['$document', function ($document) {
        return {
            append: function (ele) {
                $document[0].body.appendChild(ele.length ? ele[0] : ele);
                return this;
            },
            get: function () {
                return $document[0].body;
            }
        };
    }])
    .filter('trusAstHtml', function ($sce) {
        return function (input) {
            return $sce.trustAsHtml(input);
        }
    });

var TOAST_TPL =
    '<div class="toast-mast toast-hidden">' +
    '<div class="toast-container">' +
    '<div class="toast-wrapper">' +
    '<img class="icon" src="' + CHECK_IMAGE() + '" alt="">' +
    '<p class="text" ng-bind-html="text|trusAstHtml"></p>' +
    '</div>' +
    '</div>' +
    '</div>'
var TOPTIP_TPL =
    '<div class="toptip-mast">' +
    '<div class="toptip-container">' +
    '<img class="icon" src="' + CHECK_IMAGE() + '" alt="">' +
    '<span ng-bind="text"></span>' +
    '</div>' +
    '</div>'
var CONFIRM_TPL =
    '<div class="confirm-mast">' +
    '<div class="confirm-container">' +
    '<div class="confirm-hd" ng-bind="title"></div>' +
    '<div class="confirm-bd" ng-bind-html="content|trusAstHtml"></div>' +
    '<div class="confirm-fd">' +
    '<div class="box" ng-click="cancelBtn()" ng-bind="cancelText"></div>' +
    '<div class="box" ng-click="confirmBtn()" ng-bind="confirmText"></div>' +
    '</div>' +
    '</div>' +
    '</div>'
// 图片BASE64
function CHECK_IMAGE() {
    return 'data:image/png;base64,'
}